		public CorbaVillageLibrary(StructureCorbaVillagePieces.Start start, int type, Random rand, StructureBoundingBox boundingBox, EnumFacing facing) {
			super(start, type);
			this.setCoordBaseMode(facing);
			this.boundingBox = boundingBox;
		}

		public static CorbaVillageLibrary createPiece(StructureCorbaVillagePieces.Start start, List<StructureComponent> component, Random rand, int x, int y, int z, EnumFacing facing, int var1) {
			StructureBoundingBox structureboundingbox = StructureBoundingBox.getComponentToAddBoundingBox(x, y, z, 0, 0, 0, 16, 16, 16, facing);
			return canVillageGoDeeper(structureboundingbox) && StructureComponent.findIntersecting(component, structureboundingbox) == null ? new CorbaVillageLibrary(start, var1, rand, structureboundingbox, facing) : null;
		}
		
		public IBlockState chooseRandomBrick() {
			return RandHelper.chooseEqual(new Random(), JourneyBlocks.corbaCrackedBricks.getDefaultState(), JourneyBlocks.corbaBricks.getDefaultState(), JourneyBlocks.corbaDarkBricks.getDefaultState(), JourneyBlocks.corbaLightBricks.getDefaultState());
		}
		
